// ==UserScript==
// @name         Instant Fruit Machine
// @version      1.0
// @description  Instant Fruit Machine
// @author       Flutterz
// @match        https://www.neopets.com/desert/fruit/index.phtml
// @grant        none
// ==/UserScript==


if (document.getElementById("fruitResult")!=null){
    document.getElementById("fruitResult").style="display: block;";
    document.getElementById("fruitPending").style="display: none;";

    let result = document.documentElement.innerHTML;
    result = result.substring(result.indexOf("var FM"));
    result = result.substring(result.indexOf("[")+1,result.indexOf("]"));
    let results = result.split(",");

    let fru = [];
    fru[1]="data:image/png;base64,";
    fru[2]="data:image/png;base64,";
    fru[3]="data:image/png;base64,";
    fru[4]="data:image/png;base64,";
    fru[5]="data:image/png;base64,";
    fru[6]="data:image/png;base64,";

    let box1=document.getElementById("fruit1");
    let ins1 = document.createElement('img');
    ins1.src=fru[results[0]];
    box1.append(ins1);

    let box2=document.getElementById("fruit2");
    let ins2 = document.createElement('img');
    ins2.src=fru[results[1]];
    box2.append(ins2);

    let box3=document.getElementById("fruit3");
    let ins3 = document.createElement('img');
    ins3.src=fru[results[2]];
    box3.append(ins3);
}


